import React from 'react';
import Typography from "@material-ui/core/Typography";
import Toolbar from "@material-ui/core/Toolbar";
import AppBar from "@material-ui/core/AppBar";
import './Header.scss';
import {NavLink} from "react-router-dom";
import {appConstants} from "../constants/constant";
import Button from "@material-ui/core/Button/Button";
import {checkLogin} from "../actions/auth.action";
import {useDispatch, useSelector} from "react-redux";

const Header = () => {
    const user = useSelector(({user}) => {
        return user;
    });
    const dispatch = useDispatch();
    dispatch(checkLogin());
    const logout = () => {
        const logoutPromise = fetch('http://localhost:8080/logout', {credentials: 'include'})
            .then(res => res.json())
            .catch();
        dispatch({
            type: appConstants.LOGOUT,
            payload: logoutPromise
        });
    };
    return (
        <AppBar position="static" className="Header">
            <Toolbar>
                <Typography variant="h6" className="app-name">
                    MSI
                </Typography>
                <div className="nav-actions">
                    <NavLink to={appConstants.floorPlanRoute}>
                        <Button>Floor Plans</Button>
                    </NavLink>

                    <NavLink to={appConstants.locationsRoute}>
                        <Button>Locations</Button>
                    </NavLink>
                    <NavLink to={appConstants.quickLookRoute}>
                        <Button>QuickLook</Button>
                    </NavLink>
                    <NavLink to={appConstants.FAQRoute}>
                        <Button>FAQ</Button>
                    </NavLink>
                    <NavLink to={appConstants.loginRoute}>
                        user ?
                        <Button onClick={logout} className="auth-action">Logout</Button> :
                        <Button className="auth-action">Login</Button>
                    </NavLink>
                </div>
            </Toolbar>
        </AppBar>
    );
};
export default Header;
